import React from "react";
const Product = ({cart}) => {
  return (
<div>
  <div>{cart.title}</div>
  <div>{cart.description}</div>
  <div>
    <img src= {cart.image} alt="Product" className="w-[200px] h-[300px]" />
  </div>
  <div>
    <div> {cart.price} </div>
    <div></div>
  </div>
</div>
  );
};

export default Product;
